import React, {useState, useEffect} from 'react';
import './App.css';
import axios from 'axios'

const App = () => {

  const [result, setResult] = useState("");

  useEffect(() => {
    alert("Hello")
    const get = async () => {
      const res = await axios.post('https://localhost:5001/run', {
        content: "Hello API",
        language: "viz"
      });
      setResult(res.data);
      alert("res");
    }
    get();
  }, [])

  return (
    <div>
      <text>Hello</text>
      <text>{result}</text>
    </div>
  );
}

export default App;
